import React, { useState} from 'react';
import InputDatalist from '../../UserInterface/Input/InputDatalist';
import Checkbox from '../../UserInterface/Input/ICheckbox';
import { countries } from '../../constans/countries';
import Photogallery from '../../components/Photogallery/Photogallery';
import { image } from '../../constans/ImageGallery/image';

function Home (props){

    const [flag, steFlag] = useState(true);

    const inputChecked = flag => {
        if (flag == true) {
            return 'checked'
        } else {
            return false
        };
    }

    return(
         <div>
                <div className="">
                    HOME
                </div>

            <InputDatalist
                arrValue={countries}
                id="countriesInput"
                listId="countriesListId"
                placeholder="country"
                onchange={() => console.log('Input coutry')}
                tabindex="1"
                autocomplete = "off"
            />
            < Checkbox
                id="haveDescription"
            />
            <Photogallery
                imageArr={image}
                type
                data
                onchange
                checked
                classNameLabel
                classNameCheckbox
            />
                
        </div>
    )
}

export default Home
